import React from "react";
import myImg1 from '../images/Job.jpg';
import myImg2 from '../images/kr-logo.png';
import myImg3 from '../images/KR-Logo copy.png';
import myImg4  from '../images/kr-logo1.png';
export const Services = (props) => {
  return (
    <div id="services"  className="text-center">
      <div className="container">
        <div className="section-title">
          <h2>Our Services</h2>
          <p>These are our Services
          </p>
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div  className="col-md-6">

                  <img src={myImg1} width={500} height={300} />
                  <div className="service-desc">
                    <h3>{d.name}</h3>
                    <p>{d.text}</p>
                  </div>
                </div>
              ))
            : "loading"}
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.name}-${i}`} className="col-md-6">
                  {" "}
                  <img src={myImg2} width={500} height={300} />
                  <div className="service-desc">
                    <h3>{d.name}</h3>
                    <p>{d.text}</p>
                  </div>
                </div>
              ))
            : "loading"}
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.name}-${i}`} className="col-md-6">
                  {" "}
                  <img src={myImg3} width={500} height={300} />
                  <div className="service-desc">
                    <h3>{d.name}</h3>
                    <p>{d.text}</p>
                  </div>
                </div>
              ))
            : "loading"}
        </div>
        <div className="row">
          {props.data
            ? props.data.map((d, i) => (
                <div key={`${d.name}-${i}`} className="col-md-6">
                  {" "}
                  <img src={myImg4} width={500} height={300} />
                  <div className="service-desc">
                    <h3>{d.name}</h3>
                    <p>{d.text}</p>
                  </div>
                </div>
              ))
            : "loading"}
        </div>
      </div>
    </div>
  );
};
export default Services;
